#include<iostream>
#include <string>

using namespace std;

class Solution {
    public:
        Solution(){
            string s = "";
            cout<< compressedString(s)<<endl;
        }
        string compressedString(string s) {
            int z=s.length(),j=0,x=0;
            char c = s[0],f;
            string ans ="";
            while( j <= z ){
                if( c == s[j] && x<9 ) x++;
                else{
                    f=(char)x+48;
                    ans += f + c;
                    c=s[j];
                    x=1;
                }
                j++;
            }
            return ans;
        }
};
int main(){
    Solution a;
    return 0;
}